(75, '$75 Residential Lockout', 'residential-lockout', '<div><strong>Have you locked yourself of your home, condo or apartment? Have it your door opened by professional locksmiths for only $75!</strong></div>\n\n<div>&nbsp;</div>\n\n<div>Aluckylock can send the most competent locksmith technicians to open your locked doors at home. Your emergency is our emergency so do not think twice about calling our company. Certified and competent technicians will be there at your exact location as soon as possible.</div>\n\n<div>&nbsp;</div>\n\n<div>So you accidentally locked yourself out of your house without spare keys. Hopefully, you&#39;re bringing your phone with your because the next best option is to call for a professional residential locksmith.</div>\n\n<div>&nbsp;</div>\n\n<div>It is not recommended to try and open your home door lock without you having the right tools and proper knowledge in opening a lock. Trying to manipulate the lock with some metal objects might cause more damage to your lock mechanism which will cost your more money to spend because you will have to replace the locks as well.</div>\n\n<div>&nbsp;</div>\n\n<div>We can send out professional locksmiths who can help you with your locked home door, whether you left your keys inside the house, lost or broken. Only the experts in the field can get you back in your home without causing any damage.&nbsp;</div>\n\n<div>&nbsp;</div>\n\n<div>Stuck outside your home? No worries! We will dispatch the best residential locksmiths as soon as we&#39;ve got all details needed over the phone.&nbsp;</div>\n', 'innerpage.php', '$75 Residential Lockout  Service', '', 'We offer $75 Residential Lockout Services to all homeowners in Malibu, CA areas. Whether you are living in an apartment or your private house, we got you covered. Do not hesitate to call us if you are locked out of your home because we have a team of technicians can open even the most complicated locks.', NULL, 1),
(76, '$75 Commercial Lockout', 'commercial-lockout', '<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-cf27eed6-3e52-5c25-a5f1-1c874ce73cd0\">Locked out of your building? ALuckyLock offers you $75 Commercial Lockout Service! </span></strong></p>\n\n<p>Commercial lockouts are never easy to deal with. Whether it is a large building or a retail shop, locks are different from that of residential sectors.</p>\n\n<p>When you are locked out of your office or commercial building, there&#39;s no need to panic and definitely no reason to break a window or even cancel a day&#39;s work. What you must do is keep your cool and contact an expert in the field of commercial lockouts such as the locksmiths. Experienced and highly skilled commercial locksmiths can resolve the problem efficiently.</p>\n\n<p>Whether it is a large industrial building, a small office, or a retail store locked without keys with you, Aluckylock can send you the best technicians near your area. Commercial locks have systems that can usually be picked by only the experienced locksmiths. They&#39;ve got the right tools and proper techniques to deal with even the most complicated lockouts.</p>\n\n<p>So if you need immediate help with your locked building, all you have to do is make a call. It will take approximately 20-30 minutes depending on the distance from the available locksmith technicians.</p>\n\n<p>All of our locksmiths are mobile technicians which mean they are on the road at almost all times of the day.</p>\n\n<div>&nbsp;</div>\n', 'innerpage.php', '$75 Commercial/Business Lockout  Service', '', 'We offer $75 Commercial/Business Lockout Service for all types of businesses. Be it a corporate building or a small retail store, and we can open the lock for you in the fastest way possible. We are available 24 hours a day!', NULL, 1),
(77, '$75 Auto Lockout', 'auto-lockout', '<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-cf27eed6-4310-e4ef-1580-c73eb66dac31\">Found yourself in an emergency car lockout situation? Call us to quickly get back in your car for only $75!</span></strong></p>\n\n<p>Car lockouts can happen anytime at any situation. Whether you lost your keys or locked your keys inside the car and no way to get in, we advise that you don&#39;t try to break anything in your car. If this happens, you need to keep your cool because professional technicians are only a phone call away and they can help you get back on your day in no time!</p>\n\n<p>Auto lockouts are emergencies that need immediate action. Thus, we can send technicians who can provide immediate help and attention to the problem. We have a team of car locksmith technicians who are able to work on a wide range of car unlocking service. They are licensed and certified enough to make sure that your car will be unlocked with no damage caused at all regardless of the make and model of your car.</p>\n\n<p>There is no simple or complicated job for our technicians to handle. They are equipped with proper knowledge and advanced equipment to resolve a car lockout right away! So if your locked your keys in your car or trunk, lost your keys and need a replacement right away, we are the company you can call!</p>\n\n<div>&nbsp;</div>\n', 'innerpage.php', '$75 Car Lockout Service', '', 'We offer $75 Car Lockout Service day or night, and our nearest locksmith for cars will be at your location within 30 minutes to help with any car lockout situation. Call us for immediate assistance. We can get you back in your car in no time.', NULL, 1),
(78, '$50 Residential Lock Replacement (Minimum of $75 Purchase)', 'residential-lock-replacement', '<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-cf27eed6-42d7-6480-2311-ab7a3f200245\">$50 Residential Lock Replacement Service! Avail at a minimum of $75 Purchase</span></strong></p>\n\n<p>Lock replacement service is needed to every home from time to time. We have locksmith technicians who can arrive to your home to replace the old or rusty locks. You as the homeowner, need to make sure that all of your door locks are in good condition to avoid security troubles and attracting unauthorized access to your home. Always keep in mind that a broken lock will not protect you from criminals.</p>\n\n<p>While it is important to keep your locks in good condition on a regular basis, it is also recommended to have them checked by the professional locksmiths every now and then. You will never know when your door locks malfunction.</p>\n\n<p><strong>Reminder:</strong>&nbsp;<em>Our residential lock change cost only $50 with an additional $25 service fee for a total of $75 for a single service. But if there are more than 1 lock to replace, you will not be charged with the extra fee. So that&#39;s only $50 for each lock to replace provided that you avail 2 or more lock replacement services.</em></p>\n\n<p>When you need lock replacement, you know who to call. We can send you the most reliable locksmith experts to replace the locks on your residential door regardless of the area of your home. Contact us now!</p>\n\n<div>&nbsp;</div>\n', 'innerpage.php', '$50 Residential Lock Replacement', '', 'We offer $50 Residential Lock Replacement to all homeowners in Malibu, CA and surrounding areas. Whether you are living in an apartment or your private house, we got you covered. Don\'t hesitate to call us if you are locked out of your home; we have a team of technicians who can help out.', NULL, 1),
(79, '$75 Business Lock Replacement', 'business-lock-replacement', '<p><strong>Get Emergency Commercial Lock Replacement Service for only $75!</strong></p>\n\n<p>Have you moved into a new commercial building, experienced a recent break-in, have obsolete locks, lost a key, or have previous employees that still have keys to your commercial property? It&#39;s time to take action and have your locks replaced to avoid possible threat to your commercial space security.&nbsp;</p>\n\n<p>ALuckyLock has the best technicians who can help you get the best security for your business. They are going to determine the best service to your current situation whether you need your commercial locks changed, repaired or rekeyed. These competent technicians will do the best way possible to make sure that your business is secure from any unauthorized access.</p>\n\n<p>Our company can send you skilled technicians that have the capability to work with any type of business, big or small. They have all the necessary equipment and use industry&rsquo;s best practices to work with even the most complicated commercial locks. These technicians are licensed and bonded so no worries about dealing with the wrong people.&nbsp;</p>\n\n<p>We are committed to rendering superior services associated with customer satisfaction. The security of your business is very important to us. So give us a call anytime you need to have your commercial locks change in Malibu, CA and other surrounding areas we are currently serving.&nbsp;We are always ready to answer your calls and inquiries.&nbsp;</p>\n', 'innerpage.php', '$75 Commercial/Business Lock Replacement', '', 'We offer $75 Commercial/Business Lock Replacement services for large or small businesses. We can come on site as quickly as possible and get even the most complicated locks replaced with the use of proper tool, methods and skilled technicians.', NULL, 1),
(80, '$75 Auto Jump Start', 'jump-start', '<p><strong>Car breaks down in the middle of the road due to battery failure? Call an expert for a $75 jump start service!</strong></p>\n\n<p>Did you accidentally left your car lights on all night or all day? The next thing you know is you already have a dead battery and is stuck in the middle of the road due to a drained car battery.&nbsp;If this happens when you urgently need to go to work and you don&#39;t have jumpers, then calling a company offering a jump start service is your way to go.</p>\n\n<p>Our locksmith company can start your car immediately. With our technicians on the go, you can rest assure that you always get proper assistance which is made available 24 hours a day, 7 days a week. Our team of technicians can get the job done at anytime and anywhere - round the clock. They are able to replace a dead battery if needed.</p>\n\n<p>From the time you made a call, our customer service representatives will make sure to dispatch the best and most qualified technicians to your location for immediate roadside assistance service. We&#39;ll make sure that you get back on the road and get on your day.</p>\n\n<p>So whether your car won&#39;t start, due to a flat tire, we are the company you can rely on. We&#39;ll send dispatch right after we discussed the trouble over the phone. We&#39;ve got the team who can provide what you need with the use of proper equipment and procedures. Our customer can expect the best quality of services when they hire our highly skilled and committed technicians.</p>\n\n<p>&nbsp;</p>\n', 'innerpage.php', '$75 Jump Start Service', '', 'We offer $75 Jump Start Services for broken down cars on the roadside. We know how frustrating it can be to have a dead battery during a long drive. Do not hesitate to call us and get your can running again.', NULL, 1),
(81, '$75 Flat Tire', 'flat-tire', '<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-cf27eed6-4334-35d2-a9e7-ec7abe56fdf2\">Running flat? Call us to get your flat tire replaced immediately for only $75!</span></strong></p>\n\n<p>If your tire has ran out of air while driving in the middle of a busy road, it&#39;s always a good move to call an immediate tire change service. It&rsquo;s not recommended to continue driving on a flat tire. Pull it over immediately and call someone who can help.</p>\n\n<p>A qualified technician can deal with getting a working tire back on your car. We can send the best technicians who are able to assist you with your flat tire. They offer professional flat tire change service that is available 24/7. Our expert locksmiths will take away flats and install spares on all type of cars, trucks and sport utility vehicles.</p>\n\n<p>We can help you as well in case of a car lock-out, fuel shortage, all towing needs along with other on the road troubles but with additional charges. Our technicians are equipped with the right tools to easily remove deflated auto tires after relocating your car to a safe place. They take apart the parts of the wheel, vulcanize or replace the tube if they&#39;re beyond repair. All procedures are carried out in our mobilized vehicles and we will surely have your car back in roadworthy condition in no time.</p>\n\n<p>Hence, if you have a flat tire, need jump-start, out of gas, locked out of a car or need towing, you&#39;ll be getting the best service from our experts. We dispatch skilled team of experienced technicians to work on those deflated tires. Anytime or anywhere you need us, we&#39;ll be there in half an hour or less. So call us immediately and our techs will be there in a jiffy!</p>\n\n<div>&nbsp;</div>\n', 'innerpage.php', ' $75 Flat Tire Service', '', 'We offer $75 Flat Tire Services for broken down cars on the roadside due to flat tires. We will be coming to your location in the quickest way we can. Blown up tires during a drive and been running flat? Stop for a minute and make a call!', NULL, 1),
(82, '$75 Mailbox Services', 'mailbox-services', '<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-cf27eed6-433b-084b-abc0-9c3b15527c9f\">Protect your identity by securing your Mailboxes for only $75! CALL US NOW</span></strong></p>\n\n<p>In this modern, identity theft is widespread. This is why it is so crucial to be safeguarded and protected. One of the procedures that you can employ is to have your mailbox locks altered or installed.</p>\n\n<p dir=\"ltr\">Not just our office or homes can be intruded by bad guys, our mailboxes are also prone to this type of crime. It is truly frustrating and frightening if your essential details and documents are stolen from your mailbox.<br />\n<br />\nSo, it is important to protect your mailbox. Some mails are placed into the wayside, which is exposed to passers by and some of these people are up to no good. This is why it is important to alter your locks to make sure that you will not be a victim of identity theft.<br />\n<br />\nWhether you lost your mailbox key or never ever got a key in the first place, we can help! We provide several options to help get you to your precious mail (or bills). If your mailbox is locked we can drive to your area, drill out the old mailbox lock, place a brand-new mailbox lock, tidy up our mess, and hand you the keys. Whatever service you need most to be done, we are here to help get your mailbox issue resolved.<br />\n<br />\nDid you just move into your brand-new house? Or did you mistakenly lose your mailbox key and need a new lock? Give the most reliable locksmith in Malibu California a call!</p>\n', 'innerpage.php', '$75 Mailbox Services', '', 'We offer $75 Mailbox Services for a locked mailbox that is difficult to open. We\'ve got experts who make use of proper tools and methods to open a locked mailbox without causing any damage. Call us now for immediate mailbox services.', NULL, 1);
