(83, '$25 Rekey (Minimum of 3 Rekeys or Minimum of $75 Purchase)', 'rekey', '<p dir=\"ltr\"><strong><span id=\"docs-internal-guid-cf27eed6-4322-dbaf-8580-d488d0147b5a\">Rekey your locks to avoid unauthorized access to your properties! Call us and avail a rekeying service for only $25 each rekey.</span></strong></p>\n\n<p>Worried about someone has the keys to your house or car? This is when rekeying should be taken into great consideration. We offer our rekeying services for only $25 each rekey. You must have have a minimum of 3 locks to rekey for a total of $75 each visit.</p>\n\n<p>It is definitely uncomfortable to feel that anyone might get in your property as they might have the keys to open your locks. They might be the previous occupant in your apartment or someone who found your lost keys somewhere. Bearing in mind that they might access your place won&#39;t give you the peace of mind or even a good night sleep.</p>\n\n<p>As soon as the feeling of uncertainty regarding your security arises, you need to take action and call the professionals to have your locks rekeyed immediately. Nothing feels better than knowing your home is safe and no one can get in easily with your locks rekeyed.</p>\n\n<p>Contact us at ALuckyLock to get help for the best locksmith technicians. They can rekey any type of locks as they&#39;ve been doing this service for more than a few years now. We do not hire locksmiths that lack experience and certification. Call us and we&#39;ll send help fast!</p>\n\n<div>&nbsp;</div>\n', 'innerpage.php', '$75 Rekey Service | Call for a quote', '', 'Worried about someone has the keys to your house or car? This is when rekeying should be taken into great consideration. We offer our rekeying services for only $25 each rekey. You must have have a minimum of 3 locks to rekey for a total of $75 each visit.', NULL, 1),
(84, '$75 Ignition (Call for an instant quote)', 'ignition', '<p>Ignition is one of the most important parts of a car&#39;s system. It triggers the engine cycle which is designed to drive the vehicle forward. If you wish to avoid starting problems with your car, you want to make sure that the ignition is kept in full working condition. So it is imperative that you always make sure that you have it checked regularly or as soon as problems start to arise. When it comes to ignition troubles, we can send you renowned locksmith experts who can render the best services with the use of their skills and experience. Need ignition repair or change in the middle of the night? We&#39;ve got you covered! The best team of locksmiths will take good care of the problem immediately. We provide quick and accurate locksmith solutions for all your ignition and other automotive needs. We do our best to provide immediate assistance because lock troubles are serious problems. The proof of our dedication and quality service is our non-stop increasing number of customers. With a team of professional locksmith technicians, you can get high-quality solutions.</p>\n', 'innerpage.php', 'A Lucky Lock | $25 Ignition | Min of $75', '', '', NULL, 1),
